import axios from "axios";
import React from "react";

const Test = () => {
  const getData = async () => {
    let data = await axios.get("http://localhost:8181/sample/read");
    console.log(JSON.stringify(data.data));
    console.log(data);
    return data;
  };

  let [test, testChange] = useState(getData());

  return (
    <div>
      <p id="one">{props.test.name}</p>
      <p id="two">{props.test.age}</p>
      <button
        onClick={() => {
          console.log(test);

          let one = document.getElementById("one");
          let two = document.getElementById("two");

          one.innerHTML = props.test.name;
          two.innerHTML = props.test.age;
        }}
      >
        ajaxRead
      </button>
      <button
        onClick={async () => {
          await axios
            .post("http://localhost:8181/sample/update", {
              name: props.test.name,
              age: props.test.age + 1,
            })
            .then((result) => {
              console.log("update!");
              console.log(result.data);
              props.testChange(result.data);
              console.log(props.test);
            });
        }}
      >
        ajaxUpdate
      </button>
    </div>
  );
};

export default Test;
